import React, { useState } from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";
import { data } from "./data";

const NavBar = () => {
  const [active, setActive] = useState(false);

  const menu = (
    <>
      {data.map((element, index) => {
        return (
          <div key={index}>
            <Link className={element.className} to={element.path}>
              {element.name}
            </Link>
          </div>
        );
      })}
    </>
  );

  return (
    <div className="navbar-container">
      <nav>
        <div className="nav-container">
          <img
            className="nav-brand"
            id="img"
            alt="logo"
            src="./images/Twenteefore - Logo 2.png"
          />
         
         <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo03" aria-controls="navbarTogglerDemo03" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>{menu}
  <img className="navbar-brand"             src="./images/Twenteefore - Logo 2.png"
/>

  <div class="collapse navbar-collapse" id="navbarTogglerDemo03">
    <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Link</a>
      </li>
      <li class="nav-item">
        <a class="nav-link disabled" href="#">Disabled</a>
      </li>
    </ul>
    <form class="form-inline my-2 my-lg-0">
      <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"/>
      <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
    </form>
  </div>
</nav>
          <div className="menu"></div>
          <button className="login">LogIn</button>
          <button
            className={active ? "hamburger active-hamburger" : "hamburger"}
            onClick={() => setActive(!active)}
          >
            <span></span>
            <span></span>
            <span></span>
          </button>
        </div>
      </nav>
      <nav id="div">
        {" "}
        {active && <div className="nav-dropdown">{menu}</div>}
      </nav>{" "}
    </div>
  );
};
export default NavBar;
